def count_permutations_for_binary_strings(n, relationships):

    class Person:
        num = n - 1

        def __init__(self, rel):
            self.relationship = int(rel, 2)

        def __getitem__(self, k):
            return self.relationship >> Person.num - k & 1
    rel = [Person(rel) for rel in relationships]
    dp = [[0] * n for _ in range(1 << n)]
    for people in range(1, 1 << n):
        ones = [i for i in range(n) if people & 1 << i]
        one_num = len(ones)
        if one_num == 1:
            dp[people][ones[0]] = [1]
            continue
        for i in ones:
            dp[people][i] = [0] * (1 << one_num - 1)
            pre_people = people ^ 1 << i
            for j in ones:
                if j == i:
                    continue
                for (pre_s, times) in enumerate(dp[pre_people][j]):
                    s = pre_s | rel[j][i] << one_num - 2
                    dp[people][i][s] += times
    result = []
    people = (1 << n) + 1
    for s in range(1 << n - 1):
        ans = 0
        for i in range(n):
            ans += dp[people][i][s]
        result.append(ans)
    return result

